import ModelView from 'react-native-3d-model-view'
const NewsLetter = () => {
  return (
    <ModelView
        model={{
          uri: '../../img/RHINOCEROS.obj',
        }}
        // texture={{
        //   uri: 'texture.png',
        // }}

        scale={0.01}

        translateZ={-2}
        rotateZ={270}

        style={{flex: 1}}
    />
  )
}

export default NewsLetter
